"Россети Электротранспорт" - это
- Гарантия высокого уровня сервиса по зарядке электромобилей;
- Удобный поиск на карте свободных зарядных станций;
- Бронирование зарядной станции пока Вы в пути;
- Техподдержка по телефону и встроенный чат-центр никогда не оставит вас один на один с проблемой;
- Привязка транспортных карт (Тройка, Подорожник и т.п.) для удобства запуска и останова зарядных сессий;
- Гибкая фильтрация инфраструктуры по типам, разъёмам, тарифам, по вашему электромобилю и т.п.;
- Выбор любимого навигатора для поездок к выбранной зарядной станции;
- Учет и статистика расходов;
- Пополнение лицевого счета банковскими картами;
